	rgb(147,223,184)
	rgb(235,220,200)
	rgb(238,237,219)
	rgb(227,170,214)
	rgb(181,216,235)
	rgb(238,242,230)
	rgb(255,237,201)
	rgb(255,200,186)
	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.github-CacheView {
  width: 100%;
  height: 100%;
  overflow-y: auto;
}
.github-CacheView header {
  text-align: center;
  border-bottom: 1px solid #1b1d22;
  padding: 10px;
}
.github-CacheView-Controls {
  padding: 0 10px;
  text-align: right;
}
.github-CacheView-Clear {
  margin-left: 1em;
}
.github-CacheView-Order select {
  margin-left: 0.5em;
}
.github-CacheView table {
  margin: 10px 20px;
  width: 90%;
}
.github-CacheView thead {
  color: #d8dadf;
  background-color: #373b44;
  font-weight: bold;
}
.github-CacheView td {
  padding: 5px;
  vertical-align: top;
}
.github-CacheView-Key button {
  width: 100%;
  font-family: monospace;
  text-align: left;
}
.github-CacheView-Age {
  min-width: 100px;
}
.github-CacheView-Hits {
  min-width: 50px;
}
.github-CacheView-Content {
  white-space: pre-wrap;
  max-height: 100px;
  overflow-y: scroll;
}
